        Export
    </button>*/}
      <div className="grid grid-cols-12">
        <div className="h-screen col-span-3 bg-gray-500">
          <Template />
        </div>

        <div className="col-span-9 bg-green-200" id="exportToWord">
          <PersonalProfile />
          <Experience />
          <Education />
          <Projects />
          <Languages />
        </div>
      </div>
    <div className="absolute w-1/2 h-96 left-1 right-1 top-1/4 z-10 bg-green-600">
      sss
    </div>
    </div>
  );
};

export default App;
